    <h2 class="blog-titr">
        برنامه های شستشو ماشین لباسشویی زانوسی (ZANUSSI) 
    </h2>
    <br> 
    <br>
    <img class="style-of-orginal-brand-image" src="img/blog/برنامه های شستشو ماشین لباسشویی زانوسی/1.png" alt="تعمیرات کولرگازی ارج">
    <br>   
    <br> 
        <p class="blog-text-p">در این مقاله با نحوه ی کار با پنل ماشین لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span>  آشنا خواهید شد</p>
        <br>
        <p class="blog-alarm">نکته : این آموزش برای بیشتر مدل های ماشین لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span> قابل استفاده است .</p>
        <br>
        <p class="blog-text-p">امیدواریم از مطالعه مقاله برنامه های شستشو ماشین لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span> لذت ببرید </p>
        <a href="RepairWashingMachineOfZANUSSI.php">
            <img class="blog-tabliq-gif" src="img/blog/برنامه های شستشو ماشین لباسشویی زانوسی/تعمیرات لباسشویی زانوسی.jpg" alt="zanussi tabliq تبلیغ زانوسی تعمیر تعمیرات">
        </a>
        <p class="blog-text-titr">صفحه کنترل  ( کنترل پنل )  ماشین لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span></p>
        <br>
        <br>
        <img class="style-of-orginal-brand-image" src="img/blog/برنامه های شستشو ماشین لباسشویی زانوسی/1.png" alt="برنامه های لباسشویی زانوسی">
        <br>
        <br> 
        <p class="blog-text-p">
            1- محل ریختن پودر یا مایع لباسشویی و نرم کننده <span class="text-color-red-3">(جاپودری)</span> ماشین لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span>
            <br>
            <br>
            2- دکمه شروع یا متوقف کردن فرایند شستشو در ماشین لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span>
            در ضمن می توانید با مشاهده چراغ بالای این دکمه از وضعیت عملکرد آن با خبر شوید             
            <br>
            <br>
            3- با استفاده از این دکمه می توانید لباس ها را زمان بیشتری در لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span> نگه دارید 
            به این معنا که پس از اتمام کار میزانی از رطوبت لباس را نگه می دارد 
            تا زمانی که می خواهید لباس ها را از لباسشویی خارج بکنید 
            در این زمان ابکشی اخر را انجام می دهد و می توانید لباس ها را خارج بکنید 
            <br>
            <br>
            4- این قابلیت در ماشین لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span> برای اضافه کردن آبکشی طراحی شده است 
            به این معنا که با فشردن آن لباس های درون لباسشویی یک بار بیشتر آبکشی می شوند 
            چراغ بالای دکمه فعال بودن یا فعال نبودن این قابلیت را نمایش می دهد 
            <br>
            <br>          
            5- تایمر ماشین لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span>
            با استفاده از این قطعه می توانید برنامه های مورد نظر خود را به لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span> اعمال کنید 
            <br>
            <br>                          
        </p>
        <br>
        <p class="blog-text-titr">برنامه های موجود در تایمر ماشین لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span></p>
        <br>
        <img class="style-of-orginal-brand-image width-40-100-pc" src="img/blog/برنامه های شستشو ماشین لباسشویی زانوسی/تایمر.jpg" alt="تعمیرات کولرگازی ارج">
        <br> 
        <p class="blog-text-p">
            1- این برنامه برای متوقف کردن یا خاموش کردن ماشین لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span> به کار می رود.
            <br>
            <br>
            2- این مورد اغلب برای شستشوی لباس های کتان در ماشین لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span> به کار می رود و قبل از این اقدام لباس ها را پیش شستشو می کند .
            ( توجه کنید که دمای آب در این برنامه ی لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span> به ۹۰ درجه سانتی گراد نیز می رسد و برخی از لباس ها توانایی تحمل چنین دمایی را ندارد )                        
            <br>
            <br>
            3- این مورد اغلب برای شستشوی لباس های کتان در ماشین لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span> به کار می رود 
            ( توجه کنید که دمای آب در این برنامه ی لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span> به ۹۰ درجه سانتی گراد نیز می رسد و برخی از لباس ها توانایی تحمل چنین دمایی را ندارد )                        
            <br>
            <br>
            4- از این برنامه در ماشین لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span> برای شستشوی لباس های پنبه ای  و کتان استفاده می شود (توجه کنید که دمای آب در این برنامه ی لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span> به ۶۰ درجه سانتی گراد می رسد که این دما برای اکثر لباس ها مناسب است )
            <br>
            <br>
            5- از این برنامه در ماشین لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span> برای شستشوی لباس های پنبه ای و کتان استفاده می شود 
            (توجه کنید که دمای آب در این برنامه به ۴۰ درجه سانتی گراد می رسد و برای بیشتر لباس ها و پارچه ها مناسب است .  اما لباسشویی در این برنامه از قدرت لکه بری کمتری برخوردار است )
            <br>
            <br>          
            6- از این برنامه در لباسشویی <span class="text-color-green-4">زانوسی (ZANUSSI)</span> برای شستشوی اقتصادی استفاده می شود به این معنا که از آب و برق کمتری برای شستشوی لباس ها استفاده می شود 
            <br>
